INSERT INTO `v1_9b45900503d4971c37f980110843b32becb34dccb9ef82206f569426d2047617` VALUES (11601, 1, 0.625, 0.75, 6, "ツムギのボトルキャップ", "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。");
INSERT INTO `v1_9b45900503d4971c37f980110843b32becb34dccb9ef82206f569426d2047617` VALUES (11602, 1, 0.625, 0.75, 6, "ツムギのサマーボトルキャップ", "サマー衣装のツムギが、キャップでオンステージ！涼しげな衣装を\nまとい、熱いステージを繰り広げた彼女の勇姿を思い出すことがで\nきる。");
